import { motion } from  'framer-motion';
import {fadeIn} from '../variants';

const Banner = () => {
  return <section className='section' id='home'>
    <div className='container mx-auto'>
      <div>
        <h1>Vlad <span>Kladkovoy</span>
        </h1>
        <span>I'm</span>
        
        </div>
      <div>
        <img src={Image} alt="me" />
      </div>
    </div>
  </section>;
};

export default Banner;
